import React from 'react'
import PropTypes from 'prop-types'

function greetingsF(props) {
  return (
        <div>
            <h1> Hola  {props.name} desde componente funcional</h1>
        </div>
    );
}

greetingsF.propTypes = {
    name: PropTypes.string,
}

export default greetingsF
